      function init(){
        // height and width of window
        var height = window.innerHeight;
        var width = window.innerWidth;

        // GL and CSS scene
        sceneGL = new THREE.Scene();
        sceneCSS = new THREE.Scene();

        // Camera
        cameraGL = new THREE.PerspectiveCamera(45, width / height, 1, 10000);
        cameraGL.position.set(0, 300, 300);

        var viewSize = 900;
        var aspectRation = width / height;
        cameraCSS = new THREE.OrthographicCamera( width / - 2, width / 2, height / 2, height / - 2, 1, 1000 );
        cameraCSS.position.set(0, 0, 10);

        // Controls
        controls = new THREE.TrackballControls(cameraGL);
        controls.zoomSpeed = 0.7;

        // Renderers
        rendererGL = new THREE.WebGLRenderer();
        rendererGL.setClearColor(0x333F47, 1);
        rendererGL.setSize(width, height);
        rendererGL.sortObjects = false;
        document.body.appendChild(rendererGL.domElement);

          if (tmpParticle.MyIndex != prevNum){
            if (prevObject){
              var particleSystem = new THREE.PointCloud(prevObject, new THREE.PointCloudMaterial({color: colors[prevNumdu ]}));
              sceneGL.add(particleSystem);
            }

            prevNum = tmpParticle.MyIndex;
            prevObject = new THREE.Geometry();

            prevObject.vertices.push(tmpParticle);
          } else {

          }

      function animate(){

      function RandomParticles(numberOfParticles, max, min, minDistance){
        var part = new Array();

        for (var i=0; i<numberOfParticles; i++){
          var found = false;

          var tmpPosition;
          while (!found){
            found = true;
            var x = Math.random() * (max - min) + min;
            var y = Math.random() * (max - min) + min;
            var z = Math.random() * (max - min) + min;

            tmpPosition = new THREE.Vector3(x, y, z);

            for (var j=0, n=part.length; j<n; j++){
              if (tmpPosition.distanceTo(part[j]) <= minDistance){
                found = false;
                break;
              }
            }
          }

          var tmpParticle = new Particle(tmpPosition);
          tmpParticle.geometry.MyIndex = i;
          part.push(tmpParticle);
        }

        return part;
      }

      function CreateParticles(){
        var part = new Array();
        var scale = 10.0;

        for (var i=0; i<Texts3D.length; i++){
          var tmpPosition = new THREE.Vector3(Texts3D[i].position[0] * scale, Texts3D[i].position[1] * scale, Texts3D[i].position[2] * scale);

          var tmpParticle = new Particle(tmpPosition);
          tmpParticle.geometry.MyIndex = Texts3D[i].cluseter;
          part.push(tmpParticle);         
        }

        return part;
      }

      function Particle(positionV3){

        this.geometry = new THREE.Vector3(0, 0, 0);
        this.positionV3 = positionV3;
        
        // this.material = new THREE.MeshLambertMaterial({color: 0x55b663});
        // this.mesh = new THREE.Mesh(this.geometry, this.material);

        this.geometry.x = this.positionV3.x;
        this.geometry.y = this.positionV3.y;
        this.geometry.z = this.positionV3.z;
      }

      function hex2rgb(h) {
        return [(h & (255 << 16)) >> 16, (h & (255 << 8)) >> 8, h & 255];
      }

      function distance(a, b) {
        var d = [a[0] - b[0], a[1] - b[1], a[2] - b[2]];
        return Math.sqrt((d[0]*d[0]) + (d[1]*d[1]) + (d[2]*d[2]));
      }

      function freshColor(sofar, d) {
        var n, ok;
        while(true) {
            ok = true;
            n = Math.random()*0xFFFFFF<<0;
            for(var c in sofar) {
                if(distance(hex2rgb(sofar[c]), hex2rgb(n)) < d) {
                    ok = false;
                    break;
                }
            }
            if(ok) { return n; }
        }
      }

      function getColors(n, d) {
        var a = [];
        for(; n > 0; n--) {
            a.push(freshColor(a, d));
        }
        return a;
      }
